//userAgentの判定
var _ua = (function(u){
	return {
	isIos:(u.indexOf("iphone") != -1 || u.indexOf("ipod") != -1),
	isIe:(u.indexOf("msie") != -1 || u.indexOf("trident") != -1),
	isTablet:(u.indexOf("windows") != -1 && u.indexOf("touch") != -1)
		|| u.indexOf("ipad") != -1
		|| (u.indexOf("android") != -1 && u.indexOf("mobile") == -1)
		|| (u.indexOf("firefox") != -1 && u.indexOf("tablet") != -1)
		|| u.indexOf("kindle") != -1
		|| u.indexOf("silk") != -1
		|| u.indexOf("playbook") != -1,
	isMobile:(u.indexOf("windows") != -1 && u.indexOf("phone") != -1)
		|| u.indexOf("iphone") != -1
		|| u.indexOf("ipod") != -1
		|| (u.indexOf("android") != -1 && u.indexOf("mobile") != -1)
		|| (u.indexOf("firefox") != -1 && u.indexOf("mobile") != -1)
		|| u.indexOf("blackberry") != -1,
	isMS:(u.indexOf('msie') > -1) && (u.indexOf('opera') == -1)
		|| (u.indexOf('trident/7') > -1)
		// || (u.indexOf('edge') > -1)
	}
})(window.navigator.userAgent.toLowerCase());
console.log(_ua);

$.phonecheck = function(){
	if(_ua.isMobile == false){
		$('a[href^="tel:"]').addClass('tel-disable').on('click', function(e) {
			e.preventDefault();
		});
	}
}
$.fn.spRewrite = function(config){
	var replaceWidth = 640;
	var prefWidth = parseInt($(window).width());
	var defaults = {
		suffix: '.',
		suffix_replace: '_sp.'
	};
	opt = $.extend(defaults, config);
	var src, src_replace, _self, image;
	return this.each(function(){
		src = $(this).attr('src');
		if(src.indexOf(opt.suffix_replace) > -1){
			src_replace = src.replace(opt.suffix_replace, opt.suffix);
			image = new Image();
			image.src = src_replace;
			if(prefWidth >= replaceWidth){
				this.setAttribute('src', src_replace);
			}
		}
		else if(src.indexOf(opt.suffix) > -1){
			src_replace = src.replace(opt.suffix, opt.suffix_replace);
			image = new Image();
			image.src = src_replace;
			if(prefWidth <= replaceWidth){
				this.setAttribute('src', src_replace);
			}
		}
	});
};
var timer = false;
$(window).on('resize', function(){
	if (timer !== false) {
		clearTimeout(timer);
	}

	timer = setTimeout(function() {
		$('.spRewrite').spRewrite();
	}, 200);
});


$(document).ready(function(){
	if(window.matchMedia("(max-width: 991px)").matches){
		$('#MenuBody').attr('aria-expanded', 'false');
		$('#MenuBody').attr('aria-hidden', 'true');
	}else {
		$('#MenuBody').attr('aria-expanded', 'true');
		$('#MenuBody').attr('aria-hidden', 'false');
	}

	function matchFunction(){
		if(window.matchMedia("(max-width:990px)").matches){
			$('#MenuBody').attr('aria-expanded', 'false');
			$('#MenuBody').attr('aria-hidden', 'true');
		} else {
			$('#Menu').removeClass('st-Menu-expanded');
			$('#MenuBody').removeClass('isActive');
			$('#MenuBtn dl dd').removeClass('active');
			$('#MenuBtn').attr({
				'aria-pressed':'false',
				'aria-expanded':'false'
			});
			$('#MenuBody').attr('aria-expanded', 'true');
			$('#MenuBody').attr('aria-hidden', 'false');
		}

	}
	window.matchMedia("(max-width: 991px)").addListener(matchFunction);
});
